import React, { Component, Fragment } from 'react';
import Mynav from '../component/route/MyNav';

class Newhome extends Component{

    render (){
        return (
            <Fragment>
                <div>
                   <Mynav/>
                   <h1>New Home</h1>
                </div>
            </Fragment>
        )
    }
}
export default Newhome;
